    get year() {
        let [_, orgField] = this.get_field('year');
        let year = this[orgField];
        if (this[orgField] != '') {
            //如果沒有在year中匹配到4個數字
            if (year.match(/\d{4}/) && year.length == 4) {
                year = new idate(year);
                year = year.year.str;
                this[orgField] = year;
                return this[orgField];
            }
        };

        let language = this.language;
        let value = ''
        // 如果year 和 date 都為空，返回（出版中）
        // 如果year 為空，返回 date
        year = new idate(year);
        value = year.year.str;
        if (value == '') {
            if (language == 'zh') {
                value = `出版中`
            } else if (language == 'en') {
                value = "in press"
            }
        };

        this[orgField] = value
        return this[orgField];
    }

    get apa_year() {
        let [apaField, _] = this.get_field('apayear');
        if (this[apaField] != '') { return this[apaField] };

        let year = this.year;
        let language = this.language;
        let entryType = this.entryType;

        if (!year.match(/\d{4}/)) {
            if (language == 'zh') {
                return `（出版中）`
            } else if (language == 'en') {
                return "(in press)"
            }
        };

        let value = new idate(year);
        value.language = language;
        if (language == 'zh') {
            switch (entryType) {
                case 'misc':
                    value = value.date_zh.cirBrackets.str;
                    break;
                case 'conference':
                    value = value.date_zh.cirBrackets.str;
                    break;
                default:
                    value = value.year.cirBrackets.str;
                    break;
            }
        } else if (language == 'en') {
            switch (entryType) {
                case 'misc':
                    value = value.date_en_full.cirBrackets.str;
                    break;
                case 'conference':
                    value = value.date_en_full.cirBrackets.str;
                    break;
                default:
                    value = value.year.cirBrackets.str;
                    break;
            }
        }
        this[apaField] = value;
        return this[apaField]
    }

